"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var a={greeting:"Cześć!",im:"Jestem",quick_self_desc:"Student Informatyki i przyszły",full_desc:"Od czterech lat interesuję się tworzeniem stron i aplikacji internetowych, przy użyciu najnowszych technologii dostępnych na rynku. W wolnym czasie rozwijam swoje umiejętności i poszerzam wiedzę na temat React.js realizując projekty, które umieszczam na githubie. W osiąganiu określonych celów pomaga mi wytrwałość i determinacja. Ponadto, programowanie w przeszłości przy użyciu wielu języków pozwala mi na łatwiejsze i efektywniejsze przyswajanie nowych technologii. Dodatkowym atutem jest znajomość języka angielskiego na poziomie pozwlającym swobodnie korzystać z dokumentacji i zasobów wiedzy dostępnych w internecie. Moim celem jest nabranie doświadczenia zawodowego dzięki pracy przy komercyjnych projektach i rozwijanie swoich pasji.",my_stack:{coffee:"Kawa",thinking:"Myślenie analityczne",curiosity:"Ciekawość"},info_titles:{uni:"Uniwersytet",email:"e-mail",github:"Github"},uni:"Politechnika Krakowska im. Tadeusza Kościuszki",btn_projects:"Moje prace",btn_aboutme:"O mnie",technologies:"Stack technologiczny",spanish_app:{title:"Aplikacja do nauki słówek",desc:"W wolnych chwilach uczę się języka hiszpańskiego, więc potrzebowałem jakiegoś narzędzia do powtarzania słownictwa bo inaczej nici z postępów. Z racji moich zainteresowań postanowiłem samemu zrobić taką aplikację zamiast korzystać z tych dostępnych na rynku. W projekcie używam React.js, dzięki czemu praca nad projektem jest bardzo przyjemna i satysfakcjonująca. Firebase umożliwia mi dostarczenie każdemu użytkownikowi unikalnych doświadczeń z aplikacją dzięki temu, że każdy może zarządzać swoim własnym słownikiem, by potem korzystając z niego ćwiczyć swoje słownictwo. Prosty, ale elegancki desing z pewnością sprawia, że korzystanie z tej aplikacji jest przyjemniejsze.",link:"Wypróbuj na GitHub"},mobile_app:{title:"Aplikacja do zarządzania zadaniami",desc:"Skoro w sklepach z aplikacjami jest tyle takich jak ta, to dlaczego ja miałbym nie spróbować zrobić jej po swojemu? Możliwość oderwania się od tworzenia wyłącznie stron i aplikacji internetowych na rzecz programowania mobilnego jest dobrym sposobem na otwarcie głowy na świeże pomysły, tak więc zacząłem pracować nad tą aplikacją. Dzięki użyciu React Native zamiast natywnych rozwiązań byłem w stanie napisać aplikację na dwa systemy mając tylko jedną wersję kodu co sprawia, że praca nad tym projektem jest bardzo prosta i przyjemna.",link:"Zobacz na GitHub"},filterninja:{title:"Aplikacja do edytcji filtrów",desc:"Jako fan pewnej gry, która ma dość skomplikowany ekosystem narzędzi potrzebnych do wykorzystania wszystkich możliwości w pełni, znalazłem się w sytuacji, w której potrzebowałem czegoś do edycji specjalnego rodzaju plików – filtrów. Z racji tego, że są to zwykłe pliki tekstowe, można by je modyfikować w notatniku, ale jest to dość problematyczne ze względu na ich skomplikowaną strukturę. Zdecydowałem się na wykorzystanie technologii Electron w tym projekcie, dzięki czemu jestem w stanie przy użyciu React.js i node.js stworzyć aplikacje desktopową i wykorzystać wszystkie dostępne dla niej narzędzia, takie jak system plików. Dodatkowo, wykorzystując API daję użytkownikom możliwość użycia w swoich filtrach danych z gry, które pobierane są na żywo.",link:"Zobacz na GitHub"},commando:{title:"Port gry z C64",desc:"Moim ostatnim zadaniem w technikum na zajęciach z programowania w JavaScript było wykonanie portu jakiejkolwiek gry z Commodore 64. Szukając inspiracji natrafiłem na grę Commando, którą zdecydowałem się wybrać ze względu na to, że jest to bardzo ciekawy i trudny shooter. Był to jeden z najbardziej interesujących projektów, ponieważ wszystko musiałem wykonać sam korzystając jedynie z narzędzi dostępnych w JSie. Zachęcam do przetestowania owoców mojej pracy i sprawdzenia swoich możliwości klikając w poniższy link.",link:"Zagraj na GitHub"}},i=a;exports.default=i;
